## Description

Fazer, baseando-se na estrutura do matriculasService e matriculaRepository, o service e o repository do ranking.
Fazer os testes unitários do service baseando-se no matriculasService.spec.ts

Formato da entrada do service, vindo da controller:

```typescript
type input = {
  ano: number;
  etapa: string;
  ordem: string;
};
``` 

ATENÇÃO:
O ranking funciona da seguinte forma:
Devem ser calculadas as diferenças absolutas (módulo) entre os indicadores de brancos e pretos, estas devem ser somadas e divididas por 3 (média aritmética simples). Esse valor será índice de equidade/desigualdade.  As cidades devem ser ordenadas conforme  a ordem que será recebida, menor ou maior.

Formato de saída:

```typescript
type output = {
  name: string; // Nome do município 
  value: number; // Valor do índice calculado
}[]; // Será um vetor ordenado de acordo com a chave value e com a ordem recebida: maior ou menor
``` 

