## Description

Fazer, baseando-se na estrutura do matriculasService e matriculaRepository, o service e o repository do gráfico de indicadores.
Fazer os testes unitários do service baseando-se no matriculasService.spec.ts

Formato da entrada do service, vindo da controller:

```typescript
type input = {
  indicador: string;
  etapa: string;
  rede: string;
  municipio: string;
};
``` 

Formato de saída:

```typescript
type output = {
  categories: number []; // São os anos ex: [2019, 2020, 2021]
  series: {
    name: string; // É uma raça, ex: Brancos
    data: number []; // São os valores correspondentes a cada ano ex: [12, 34, 14]
} []; // São dois objetos dentro de series, um para cada raça
};
``` 

